export interface IPoint {
  x: number;
  y: number;
}

export function getGridPoints(cols:number, rows:number): IPoint[] {
  const w = window.innerWidth;
  const h = window.innerHeight;
  const points = [];

  const cellWidth = w / cols;
  const cellHeight = h / rows;
  const shift = cellWidth * 0.25; // смещаем на четверть ширины ячейки

  for (let i = 0; i < rows; i++) {
    for (let j = 0; j < cols; j++) {
      let x = (j + 0.5) * cellWidth;
      const y = (i + 0.5) * cellHeight;
          
      if (i % 2 === 0) {
        x -= shift;
      } else {
        x += shift;
      }

      points.push({ x, y });
    }
  }

  return points;
}

/**
 * Генерирует змейковую (горизонтальную) траекторию внутри заданного прямоугольника [left..right]×[top..bottom].
 * startFromLeft = true  — значит, первая точка каждой новой строки лежит в левом столбце (x = left),
 * startFromLeft = false — в правом (x = right).
 * 
 * В качестве «высоты шага» по вертикали берётся stepY.
 */
function generateSnakeInRect(
  left: number,
  right: number,
  top: number,
  bottom: number,
  stepY: number,
  startFromLeft: boolean
): IPoint[] {
  const pts: IPoint[] = [];
  let directionLeftToRight = startFromLeft;

  // Пробегаем по строкам: y = top, top + stepY, top + 2·stepY, ... пока <= bottom
  for (let y = top; y <= bottom; y += stepY) {
    if (directionLeftToRight) {
      // сначала в левый край, затем в правый
      pts.push({ x: left, y });
      pts.push({ x: right, y });
    } else {
      // сначала в правый край, затем в левый
      pts.push({ x: right, y });
      pts.push({ x: left, y });
    }
    directionLeftToRight = !directionLeftToRight;
  }

  return pts;
}

/**
 * Генерирует массив точек по спиральной траектории:
 * 1) «Змейкой» проходит от правого верхнего угла (с отступом) к левому краю,
 *    шаг вниз на фиксированную величину, затем обратно вправо, снова вниз и т.д. —
 *    до тех пор, пока не дойдёт до нижнего отступа.
 * 2) После достижения нижнего отступа: границы (левую, правую, верхнюю и нижнюю) 
 *    сдвигаем на один шаг внутрь, возвращаемся диагонально к точке чуть ниже 
 *    начального (левого) верхнего положения нового уровня и продолжаем «змейку» 
 *    внутри уже суженных границ.
 * 3) Когда после таких циклов мы дойдём до «центра» (границы пересеклись или слишком малы), 
 *    генерируем зеркальное повторение всего пути в обратном порядке, чтобы «вернуться» 
 *    к стартовой (правой верхней) точке.
 */
function generateOuterSpiral(
  screenWidth: number,
  screenHeight: number,
  margin: number,
  step: number
): IPoint[] {
  // Начальные границы «коробки»
  let leftX = margin;
  let rightX = screenWidth - margin;
  let topY = margin;
  let bottomY = screenHeight - margin;

  const points: IPoint[] = [];

  // 1) Сначала идём «змейкой» во внешней коробке:
  let direction: "left" | "right" = "right";
  // Стартуем из левой верхней точки
  let x = leftX;
  let y = topY;
  points.push({ x, y });

  while (true) {
    // Двигаемся по горизонтали к текущей границе (leftX или rightX) на той же Y
    if (direction === "left") {
      x = leftX;
    } else {
      x = rightX;
    }
    points.push({ x, y });

    // Попытаемся сделать шаг вниз
    const nextY = y + step;
    if (nextY > bottomY) {
      // Если следующий шаг уходит за границу — прерываем внешний цикл
      break;
    }

    // Сдвигаемся вертикально вниз на 'step'
    points.push({ x, y: nextY });
    y = nextY;

    // Меняем горизонтальное направление
    direction = direction === "left" ? "right" : "left";
  }

  // 2) Переход к следующему «внутреннему слою»:
  // — уходим внутрь по всем четырём границам на один «step»,
  // — возвращаемся диагонально к точке (rightX₂, topY₂),
  //    где rightX₂ = oldRightX - step, topY₂ = oldTopY + step.
  // Затем начинаем снова «змейку» внутри новых границ, пока они не пересекутся.

  // Сдвигаем границы внутрь
  leftX += step;
  rightX -= step;
  topY += step;
  bottomY -= step;

  // Вычисляем точку диагонали (точка старта «змейки» для внутренней коробки):
  if (points.length > 0) {
    points.push({ x: leftX, y: topY });
    x = leftX;
    y = topY;
    direction = "left";
  }

  // Внутренние витки «змейки»
  while (leftX < rightX && topY < bottomY) {
    // По горизонтали к границе
    if (direction === "left") {
      x = leftX;
    } else {
      x = rightX;
    }
    points.push({ x, y });

    // Шаг вниз
    const nextY = y + step;
    if (nextY > bottomY) {
      break;
    }
    points.push({ x, y: nextY });
    y = nextY;

    // Меняем направление
    direction = direction === "left" ? "right" : "left";

    // Если в конце очередного «журнала» мы подошли к границам, и нужен следующий виток:
    // Проверяем, не пора ли «углубиться» ещё сильнее:
    if ((direction === "left" && x === leftX) || (direction === "right" && x === rightX)) {
      // Если после горизонтального перехода мы не можем шагнуть вниз, переходим к новому внутреннему витку:
      if (y + step > bottomY) {
        // Сдвигаем границы внутрь ещё на «step»
        leftX += step;
        rightX -= step;
        topY += step;
        bottomY -= step;

        if (!(leftX < rightX && topY < bottomY)) {
          // Если границы «пересеклись» — выходим из цикла построения
          break;
        }

        // Диагональный переход к точке (currentX, currentY) = (правый внутренний, верхний внутренний)
        x = leftX;
        y = topY;
        points.push({ x, y });
        direction = "left"; // снова едем налево
      }
    }
  }

  // 3) Спускаемся к «центру» (точка prev уже добавлена в while),
  //    теперь зеркально возвращаемся к исходному старту.
  //    Для «зеркального возврата» просто берём все собранные points и
  //    добавляем их же в обратном порядке (кроме последней центра, чтобы не дублировать).
  const forwardPoints = [...points];
  for (let i = forwardPoints.length - 2; i >= 0; i--) {
    points.push(forwardPoints[i]);
  }

  return points;
}

/**
 * Собирает всю итоговую траекторию:
 * 1) Сначала переходим от стартовой (правый верхний угол + margin) к «центру экрана» (centralRect). 
 * 2) Затем внутри centralRect «змейкой» проходим 
 *    (left = screenWidth*0.2, right = screenWidth*0.8, top = screenHeight*0.2, bottom = screenHeight*0.8).
 * 3) После того, как «центральная змейка» закончена, «диагонально» возвращаемся к точке (screenWidth - margin, margin)
 *    — и из неё уже запускаем внешний спиральный обход. 
 */
export function generateFullTrajectory(): IPoint[] {
  const w = window.innerWidth;
  const h = window.innerHeight;

  // 1) Константы
  const margin = 100; // отступ от краёв для внешней «спирали»
  const step = w / 10; // шаг «змейки» и «спирали»

  // 2) Центральная прямоугольная область, в которой хотим «максимально плотно» покрыть змейку:
  const centralLeft = w * 0.2;
  const centralRight = w * 0.8;
  const centralTop = h * 0.2;
  const centralBottom = h * 0.6;

  // **Результирующий массив точек всей траектории**
  const allPts: IPoint[] = [];

  // --- A) Стартовая точка (правый верхний угол + margin) ---
  const startX = margin;
  const startY = margin;
  allPts.push({ x: startX, y: startY });

  // --- B) Переход «диагонально» к началу «центральной змейки» ---
  //    Пусть «начальной точкой» внутри центральной области будет её левый верхний угол.
  allPts.push({ x: centralLeft, y: centralTop });

  // --- C) Генерация «змейки» внутри centralRect ---
  //    - stepY именно step, чтобы по вертикали происходил такой же упорядоченный обход.
  //    - Начинаем «слева направо» (startFromLeft = true).
  const centralSnake = generateSnakeInRect(
    centralLeft,
    centralRight,
    centralTop,
    centralBottom,
    step,
    true
  );
  allPts.push(...centralSnake);

  // --- D) Возврат «диагонально» к старту внешней спирали: (margin, margin) ---
  //    После того как мы дошли до последней строки центральной змейки, current = last элемент из centralSnake.
  //    Нам нужно «прыгнуть» на (startX, startY). Добавляем точку напрямую:
  allPts.push({ x: startX, y: startY });

  // --- E) Внешняя «спираль» (как раньше):
  const outerSpiral = generateOuterSpiral(w, h, margin, step);

  //    Но в outerSpiral первая точка уже равна {x: startX, y: startY}, 
  //    поэтому, чтобы не дублировать, пропустим её:
  outerSpiral.shift();
  allPts.push(...outerSpiral);

  return allPts;
}

